// import  React from "react";
import React, { CSSProperties } from "react";

import logo from '../../assets/img/COD_LOGO.png';
import icon from '../../assets/img/favicon.png'
import apple from '../../assets/img/apple-touch-icon.png'

import './style.css';
// import './scripts.js';

// import React, { CSSProperties } from "react";


function Home(): JSX.Element {

    const myStyles: CSSProperties = {
        marginTop: 400,
    }

  return (
    <>
        <head>
        <meta charSet="utf-8"></meta>
        <meta content="width=device-width, initial-scale=1.0" name="viewport"></meta>

        <title>Inner Page - Arsha Bootstrap Template</title>
        <meta content="" name="description"></meta>
        <meta content="" name="keywords"></meta>

        {/* <!-- Favicons --> */}
        <link href={icon} rel="icon"></link>
        <link href={apple} rel="apple-touch-icon"></link>

        {/* <!-- Google Fonts --> */}
        <link href="https://fonts.googleapis.com/css?family=Open+Sans:300,300i,400,400i,600,600i,700,700i|Jost:300,300i,400,400i,500,500i,600,600i,700,700i|Poppins:300,300i,400,400i,500,500i,600,600i,700,700i" rel="stylesheet"></link>

        {/* <!-- Vendor CSS Files --> */}
        <link href="assets/vendor/aos/aos.css" rel="stylesheet"></link>
        <link href="assets/vendor/bootstrap/css/bootstrap.min.css" rel="stylesheet"></link>
        <link href="assets/vendor/bootstrap-icons/bootstrap-icons.css" rel="stylesheet"></link>
        <link href="assets/vendor/boxicons/css/boxicons.min.css" rel="stylesheet"></link>
        <link href="assets/vendor/glightbox/css/glightbox.min.css" rel="stylesheet"></link>
        <link href="assets/vendor/remixicon/remixicon.css" rel="stylesheet"></link>
        <link href="assets/vendor/swiper/swiper-bundle.min.css" rel="stylesheet"></link>

        {/* <!-- Template Main CSS File --> */}
        <link href="./style.css" rel="stylesheet"></link>

        </head>

    <body>
{/* <!-- ======= Header ======= --> */}
        <header id="header" className="fixed-top header-inner-pages">
        <div className="container d-flex align-items-center">

            <h1 className="logo me-auto"><a href="#">Arsha</a></h1>
            {/* <!-- Uncomment below if you prefer to use an image logo --> */}
            <a href="index.html" className="logo me-auto"><img src={logo} alt="" className="img-fluid"></img></a>

            <nav id="navbar" className="navbar">
            <ul>
                <li><a className="nav-link scrollto " href="#hero">Home</a></li>
                <li><a className="nav-link scrollto" href="#about">About</a></li>
                <li><a className="nav-link scrollto" href="#services">Services</a></li>
                <li><a className="nav-link   scrollto" href="#portfolio">Portfolio</a></li>
                <li><a className="nav-link scrollto" href="#team">Team</a></li>
                <li className="dropdown"><a href="#"><span>Drop Down</span> <i className="bi bi-chevron-down"></i></a>
                <ul>
                    <li><a href="#">Drop Down 1</a></li>
                    <li className="dropdown"><a href="#"><span>Deep Drop Down</span> <i className="bi bi-chevron-right"></i></a>
                    <ul>
                        <li><a href="#">Deep Drop Down 1</a></li>
                        <li><a href="#">Deep Drop Down 2</a></li>
                        <li><a href="#">Deep Drop Down 3</a></li>
                        <li><a href="#">Deep Drop Down 4</a></li>
                        <li><a href="#">Deep Drop Down 5</a></li>
                    </ul>
                    </li>
                    <li><a href="#">Drop Down 2</a></li>
                    <li><a href="#">Drop Down 3</a></li>
                    <li><a href="#">Drop Down 4</a></li>
                </ul>
                </li>
                <li><a className="nav-link scrollto" href="#contact">Contact</a></li>
                <li><a className="getstarted scrollto" href="#about">Get Started</a></li>
            </ul>
            <i className="bi bi-list mobile-nav-toggle"></i>
            </nav>
            {/* <!-- .navbar --> */}

        </div>
        </header>
        {/* <!-- End Header --> */}

    </body>

    </>
  )
};

export default Home;
